import React, {Component} from 'react';
import PropTypes from 'prop-types';
import './App.css';
import {connect} from 'react-redux';
import {fetchRequest} from './redux/actions/fetchRequestAction';

import HouseMap from './HouseMap';

class App extends Component {

    componentDidMount(){
        this.props.fetchRequest();
    }

    render() {
        return (
            <div className='wrapper'>
                {this.props.getItems.map(({full_address, images, area, price}) => 
                <React.Fragment>
                <div className='block1'>
                <HouseMap >
                    <img src='https://img01-olxua.akamaized.net/img-olxua/564962736_12_644x461_srochnoprodam-dom-240-mkv-pergoloseevskiy-12-_rev021.jpg' alt=''/>
                    <p>{full_address}</p>
                    <h3>{price}</h3>
                    <p>{area}</p>
                </HouseMap>
                </div>

                <div className='block2'>
                <HouseMap>
                    <p>{full_address}</p>
                    <img src='https://img01-olxua.akamaized.net/img-olxua/564962736_12_644x461_srochnoprodam-dom-240-mkv-pergoloseevskiy-12-_rev021.jpg' alt=''/>
                    <h3>{price}</h3>
                    <p>{area}</p>
                </HouseMap>
                </div>

                <div className='block3'>
                <HouseMap>
                    <p>{full_address}</p>
                    <img src='' alt=''/>
                    <h3>{price}</h3>
                    <p>{area}</p>
                </HouseMap>
                </div>

                </React.Fragment>
                )}
            </div>
        );
    }
}

const mapStateToProps = (store) => ({
    getItems: store.getItems,
})

const mapDispatchToProps = (dispatch) => ({
    fetchRequest:  () => {
        dispatch(fetchRequest())
    },
})



export default connect(mapStateToProps, mapDispatchToProps)(App);
